    "from tensorflow.keras import layers\n",
    "\n",
    "def plot_history(history):\n",
    "  plt.plot(history.history['loss'], label='loss')\n",
    "  plt.plot(history.history['val_loss'], label='val_loss')\n",
    "  plt.xlabel('Epoch')\n",
    "  plt.ylabel('Error [OP]')\n",
    "  plt.legend()\n",
    "  plt.grid(True)"
