    "# Make ss process model\n",
    "# W1 = ctrl.rss(2, 1, 1)\n",
    "\n",
    "A = [[ 1.25995527, -8.43046078],\n",
    " [ 2.74453578, -2.50931661]]\n",
    "\n",
    "B = [[ 0.69248978],\n",
    " [-1.18452031]]\n",
    "\n",
    "C = [[-0.50462121, -0.        ]]\n",
    "\n",
    "D = [[-0.]]\n",
    "\n",
    "T = np.linspace(0, 10, 50)\n",
    "Y = np.zeros_like(T)\n",
    "W1 = ctrl.StateSpace(A, B, C, D)\n",
    "\n",
    "Y1, T1, X1 = ctrl.lsim(W1, U=np.ones_like(T), T=T)\n",
    "plt.subplot(121)\n",
